import React from 'react';
import './styles.css'
import Greeting from '../DoctorDashboard/Greeting/Greeting'
import UserTable from './UserTable'
import Navbar from "../HomePage/Navbar"


function AdminLogin() {

  const patient_A = {type: "patient", name:"A",userId:"100", password: "abcd", history:null,province:"BC"}
  const patient_B = {type: "patient", name:"B",userId:"101", password: "1234", history:null,province:"ON"}
  const patient_C = {type: "patient", name:"C",userId:"102", password: "asdfghjkl", history:null,province:"AB"}
  const new_admin= {
    name: "Nero",
    userId: "001",
    type: "admin",
    password: "failing309",
    province: ""
  }
  const all_user = [patient_A, patient_B, patient_C, new_admin]

  return (
    <div>
      <Navbar />
      <div className="admin_dashboard_background">
        <Greeting className="greeting" name={new_admin.name} userId={new_admin.userId} /> <br/>
        <UserTable users={all_user} />
      </div>
    </div>
  );
}

export default AdminLogin;
